// import F10 from "./components/exam/F10.vue"
// import Home from "./components/weixin/Home.vue"
// import MessageList from "./components/weixin/common/MessageList.vue"
// import Login from "./components/xz/Login.vue"
// //////////////////////////////////////////////////////////////////////////////////////
import footer from "./components/zuipin/footer.vue"
import header from "./components/zuipin/header.vue"
import index from "./components/zuipin/index.vue"
import carousel from "./components/zuipin/carousel/carousel.vue"
import c1 from "./components/zuipin/carousel/c1.vue"


import ex from "./components/zuipin/ex.vue"


// 登录组件
import user from "./components/zuipin/user.vue"
// 购物车组件
import cart from "./components/zuipin/car.vue"
import xzc from "./components/zuipin/carts.vue"
// 商品详情页组件
import product from "./components/zuipin/product.vue"
// 404组件
import nofound from "./components/zuipin/404.vue"


// 自饮组件
import first from "./components/zuipin/index/first.vue"
// 送礼组件
import seconend from "./components/zuipin/index/seconend.vue"
// 茶器组件
import tf from "./components/zuipin/index/tf.vue"


Vue.use(Router)
export default new Router({
  routes: [
    // {path:'/Login',component:Login},
    // {path:'/MessageList',component:MessageList},
    // {path:'/Home',component:Home},
    // {path:'/F10',component:F10},
    // {path:'/ExamTabbar08',component:ExamTabbar08},
    // {path:'/ExamContainer07',component:ExamContainer07},
    // {path:'/ExamContainer06',component:ExamContainer06},
    // {path:'/Exam05',component:Exam05},
    // {path:'/Homework04',component:Homework04},
    // {path:'/Exam03',component:Exam03},
    // {path:'/Exam02',component:Exam02},
    // {path:'/',component:HelloContainer},
    // {path:'/Exam01',component:Exam01},
    // ////////////////////////////////////////////////////////////////////////////////////
    {path:'/header',component:header},
    {path:'/footer',component:footer},
    {path:'/index',component:index},
    {path:'/carousel',component:carousel},
    {path:'/c1',component:c1},
    //登录组件
    {path:'/user',component:user},
    // 购物车
    {path:'/cart',component:cart},
    {path:'/xzc',component:xzc},
    // 商品详情页
    {path:'/product',component:product},
    // 404
    {path:'/nofound',component:nofound},
    // 自饮组件
    {path:'/first',component:first},
    // 送礼组件
    {path:'/seconend',component:seconend},
    // 茶器组件
    {path:'/tf',component:tf},
    // 
    {path:'/ex',component:ex},

  ]
})
